import React, { Component } from 'react';

class HeaderComponent extends Component {
    render(){
        return (
            <div className="container">
                <div className="row">
                    <div className="col-md-6">
                        <h1>Legacy Library</h1>
                    </div>
                    <div className="col-md-14">
                        <h1>Welcome |</h1>
                    </div>
                </div>
            </div>
        );
    }
}

export default HeaderComponent;
